import React, { useEffect, useState } from 'react'
import { fetchAllTrialsFromAPI } from '../../api/StaticData'
import TimelineChart from './charts/TimeLineChart'

const SunburstChartPage = () => {
  const [staticData, setStaticData] = useState([])
  const [dataLoaded, setDataLoaded] = useState(false)

  useEffect(() => {
    const fetchStaticData = async () => {
      try {
        const fetchedStaticData = await fetchAllTrialsFromAPI()
        setStaticData(fetchedStaticData)
        setDataLoaded(true)
      } catch (error) {}
    }

    fetchStaticData()
  }, [])

  console.log('Print1: ', staticData)
  console.log('Print1: ', dataLoaded)
  const data = [
    { '1st trial': 8.0 },
    { '2nd trial': 6.0 },
    { '3rd trial': 6.0 },
    { '3rd trial': 6.0 },
    { '3rd trial': 6.0 },
    { '3rd trial': 6.0 },
  ]

  return (
    <React.Fragment>
      <div className="pages-container">
        <div className="pages-text">
          <h1>Sunburst Chart</h1>
          {dataLoaded && <TimelineChart data={data} />}
        </div>
      </div>
    </React.Fragment>
  )
}

export default SunburstChartPage
